  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Horicon National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1946. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, raptors, fish, and disease- is also
  covered. The Refuge development and maintenance section discusses physical development,
  plantings, collections and receipts, prescribed fires, and wildfires. Resource management
  is outlined; topics include grazing and timber harvesting. The public relations
  section of the report describes recreational uses, Refuge visitors, and Refuge participation.\",\n\t\"owner_org\":
